function App() {
  const handleInput = (ev) => {
    console.log('La última techa pulsada es:', ev.key);
  };
  return (
    <div>
      <form>
        <input type="text" onKeyUp={handleInput}></input>
      </form>
    </div>
  );
}

export default App;
